info:
  contact: {email: frikky@shuffler.io, name: '@frikkylikeme', url: 'https://twitter.com/frikkylikeme'}
  description: Automated generation of Qualys Vulnerability Scanner
  title: Qualys Vulnerability Scanner
  version: 1.0.0
  x-logo: data:image/png;base64,
openapi: 3.0.2
paths:
  tmp0:
    post:
      description: Import records from Qualys based on a previous scan run
      parameters:
      - description: The Qualys scan name.
        example: Test Scan
        in: query
        name: Scan
        required: true
        schema: {type: string}
      responses:
        '200':
          content:
            application/json:
              schema: {$ref: '#/components/schemas/tmp0'}
          description: Successful request
      summary: Qualys Latest Scan Data
  tmp1:
    post:
      description: Import records from Qualys
      parameters:
      - description: An IP Address or Range to filter for
        example: 0.0.0.0-10.255.255.255
        in: query
        name: ip_range
        required: true
        schema: {type: string}
      responses:
        '200':
          content:
            application/json:
              schema: {$ref: '#/components/schemas/tmp1'}
          description: Successful request
      summary: Qualys Get Host Detections
  tmp2:
    post:
      description: Import records from Qualys
      parameters:
      - description: The Qualys scan name.
        example: Test Scan
        in: query
        name: Scan
        required: true
        schema: {type: string}
      - description: The IP address to scan.
        example: 127.0.0.1
        in: query
        name: ip
        required: true
        schema: {type: string}
      - description: The scan option title.
        example: Initial Options
        in: query
        name: Options Title
        required: true
        schema: {type: string}
      responses:
        '200':
          content:
            application/json:
              schema: {$ref: '#/components/schemas/tmp2'}
          description: Successful request
      summary: Qualys Scan
tags:
- {name: Vulnerability & Patch Management}
